import React, { Fragment } from "react";
import { Heading } from "../../../styles/component/style";
import { Header } from "../../internal/Header/Header";
import { Padding } from "../../internal/PartyDetails/styles";

const Index = () => {
  return (
    <Header showSidebar selectedItem="home">
      <Fragment>
        <Padding>
          <Heading>Demo Components</Heading>
        </Padding>
      </Fragment>
    </Header>
  );
};
export default Index;
